import React from "react";
import Header from "../Components/Header";
import Footer from "../Components/Footer";
import { DivLogin, HeaderContent, Input, Button } from "../style/login";

const Contact = () => {
  return (
    <div>
      <Header></Header>
      <DivLogin>
        <HeaderContent>
          <h1>Log In</h1>
        </HeaderContent>

        <form>
          <Input
            type="email"
            name="mail"
            placeholder="Enter Your Email"
            requuired
          />
          <Input
            type="password"
            name="pwd"
            placeholder="Enter Your Password"
            requuired
          />
          <Button
            onClick={() => {
              navigate("/");
            }}
          >
            Log In
          </Button>
        </form>
      </DivLogin>
      <Footer></Footer>
    </div>
  );
};

export default Contact;
